import React, { Component } from "react";
import { Provider } from "react-redux";
import configureStore from "../ConfigureStore";
import SportsContainer from "./sports/SportsContainer";
import SportContainer from "./sports/SportContainer";
import LeaguesContainer from "./leagues/LeaguesContainer";
import LeagueContainer from "./leagues/LeagueContainer";
import AlertsContainer from "./AlertsContainer";
import { BrowserRouter as Router, Route } from "react-router-dom";

const store = configureStore();

export default class Root extends Component {
  render() {
    return (
      <Provider store={store}>
        <AlertsContainer />
        <Router>
          <Route path="/sports" component={SportsContainer} />
          <Route path="/sports/:id" component={SportContainer} />
          <Route path="/leagues" component={LeaguesContainer} />
          <Route path="/leagues/:id" component={LeagueContainer} />
        </Router>
      </Provider>
    );
  }
}
